import React from 'react';
import Color from './Color';

function Events(){

    const change =()=>{
        Color[0].backgroundColor = 'pink';
        Color[1].backgroundColor = 'brown';
    }
    return(
        <>
        <div style={Color[0]}>
            <button style={Color[1]} onClick={change}>Click</button>
        </div>
        </>
    )
}

export default Events;
